import React, { useState, useEffect } from 'react'
import axios from 'axios'

const App = () => {

  let ausgabe;
  const [loading, setLoading] = useState(true); 

  useEffect(() => {
    axios.get('https://hk-test-api.herokuapp.com/albums', {headers: {
      accept: 'application/json',
      'X-API-Key': 'secret'
  }})
    .then((response) => {
        console.log(response.data)
        ausgabe = response.data
    })
    .catch(e => {
        console.log('Error: ', e.response.data)
    });
  },[])

  return (
    <div className="App">
      <p>Hallo Meister</p>
      <p>{ausgabe.map((res) => {
        return res
      })}</p>
      <p>Test</p>
    </div>
  );
}

export default App;
